import React from'react'; 

const Doggy =()=>{
    const[dog, setDog] =React.useState([]);

    React.useEffect(() => {
        const Type="hound";

        fetch(
            `https://dog.ceo/api/breed?${Type}`
            )
        .then((res)=>res.json())
        .then((json)=>{
            setDog(json.resulets); 
        })

    },[]);

    return (
        <div className="dog">
            {dog?.map((item)=>(
                <div key={item.id}>
                    <p>{item.Type}</p>
                </div>

            ))}

        </div>
    );


};
export default Doggy;
